import React from "react";
import "./App.css";

function Welcome() {
  return (
    <div>
      <h1>
        <span className="got-font">Game of Thrones</span> <br></br>
        Winter has Cometh ...
      </h1>

      <p className="text">
        This application uses data pulled from a{" "}
        <strong>Game of Thrones API</strong> to allow <br></br>
        users to search for a GOT character by their{" "}
        <strong> first name </strong> and build a <br></br>
        <strong>doughnut chart</strong> displaying the number of people in each
        House.
      </p>

      <h2>Data provided from</h2>
      <a href="https://thronesapi.com/api/v2/Characters">
        https://thronesapi.com/api/v2/Characters
      </a>
    </div>
  );
}

export default Welcome;
